import{_ as t,c as e,o as a,a5 as d,bI as r,bN as l,bO as n,bP as i,bQ as o,bR as c,bS as s,bT as p,bU as h}from"./chunks/framework.CDn1DTpl.js";const z=JSON.parse('{"title":"声笔简整","description":"","frontmatter":{"title":"声笔简整","date":"2019-07-08T16:14:45.000Z","comments":false,"tags":["简整","顶功","声笔"],"typora-root-url":"..\\\\..\\\\public"},"headers":[],"relativePath":"sbjz/index.md","filePath":"docs/sbjz/index.md"}'),_={name:"sbjz/index.md"},g=d('<h2 id="_1-概述" tabindex="-1">1 概述 <a class="header-anchor" href="#_1-概述" aria-label="Permalink to &quot;1 概述&quot;">​</a></h2><p>声笔简整是独特的普及型顶功输入方案，是现在流行的智能全拼输入法最好替代和升级方案，是广大普通用户输入中文的最佳选择。本文是图文教程，视频教程请移步<a href="https://" target="_blank" rel="noreferrer">声笔输入法边播边讲24XXXX</a>，可以参照学习。</p><h2 id="_2-优势" tabindex="-1">2 优势 <a class="header-anchor" href="#_2-优势" aria-label="Permalink to &quot;2 优势&quot;">​</a></h2><p>声笔简整的优势可以总结为：简单性、高效性和知识性。对于普通用户来说，它比拼音更简单，比五笔更高效，还有利于人们巩固语文知识。</p><h3 id="_2-1-比拼音更简单" tabindex="-1">2.1 比拼音更简单 <a class="header-anchor" href="#_2-1-比拼音更简单" aria-label="Permalink to &quot;2.1 比拼音更简单&quot;">​</a></h3><p>声笔简整非常简单，具有易学、易用的优点，只需要知道用v表示零声母，用aeuio分别表示折、横、撇、竖、捺五种笔画，便可以上手使用了。与搜狗拼音、百度拼音等拼音输入法相比，它不用区分平、翘舌，不需要知道韵母，因而也没有区分前、后鼻音等的烦恼。</p><p>根据王力德《汉字编码的普及目标体系与编码实例》的研究，在各种汉字属性中，声母和笔顺在必修系数、规范系数、简单系数和记忆系数四大方面得分都是最高的，如下表所示。</p><table><thead><tr><th style="text-align:center;">汉字属性</th><th style="text-align:center;">必修系数</th><th style="text-align:center;">规范系数</th><th style="text-align:center;">简单系数</th><th style="text-align:center;">记忆系数</th><th style="text-align:center;">合计</th></tr></thead><tbody><tr><td style="text-align:center;">部首</td><td style="text-align:center;">1</td><td style="text-align:center;">0.5</td><td style="text-align:center;">0.5</td><td style="text-align:center;">0</td><td style="text-align:center;">2</td></tr><tr><td style="text-align:center;">字根</td><td style="text-align:center;">1</td><td style="text-align:center;">0</td><td style="text-align:center;">0</td><td style="text-align:center;">0</td><td style="text-align:center;">1</td></tr><tr><td style="text-align:center;">角形</td><td style="text-align:center;">0</td><td style="text-align:center;">0.5</td><td style="text-align:center;">0.5</td><td style="text-align:center;">1</td><td style="text-align:center;">2</td></tr><tr><td style="text-align:center;">字型结构</td><td style="text-align:center;">1</td><td style="text-align:center;">0.5</td><td style="text-align:center;">0.5</td><td style="text-align:center;">1</td><td style="text-align:center;">3</td></tr><tr><td style="text-align:center;">笔顺</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">4</td></tr><tr><td style="text-align:center;">笔画数</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">0</td><td style="text-align:center;">0</td><td style="text-align:center;">2</td></tr><tr><td style="text-align:center;">声母</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">4</td></tr><tr><td style="text-align:center;">韵母</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">0.5</td><td style="text-align:center;">1</td><td style="text-align:center;">3.5</td></tr><tr><td style="text-align:center;">声调</td><td style="text-align:center;">1</td><td style="text-align:center;">1</td><td style="text-align:center;">0.5</td><td style="text-align:center;">1</td><td style="text-align:center;">3.5</td></tr></tbody></table><p>表中，必修系数为某汉字属性对“中小学语文课所必修”的隶属度，必修者为1，非必修者为0。规范系数为某汉字属性对规范性的隶属度；完全明确且有公认的统一标准，不产生歧义者为1；基本有公认标准，但使用时存在比较大的模糊性为0.5；没有公认标准，无论范围或分类全部都是各家任意规定，模糊性相当严重者为0。简单系数为某汉字属性对简单性的隶属度；简单、直观、易掌握者为1，有一定难度者为0.5，难学者为0。记忆系数为某汉字属性对记忆性的隶属度；某属性种类少，记忆量少，无须强制记忆，回生率低则为1；反之为0；介于两者间的为0.5。</p><p>声笔简整仅仅使用了不分平翘舌的声母和按书写顺序的笔画，所以它在必修系数、规范系数、简单系数和记忆系数四个方面都是最好的。不仅如此，汉字的笔画信息还十分丰富，给编码带来了巨大的灵活性，可以做到伸缩自如。</p><h3 id="_2-2-比五笔更高效" tabindex="-1">2.2 比五笔更高效 <a class="header-anchor" href="#_2-2-比五笔更高效" aria-label="Permalink to &quot;2.2 比五笔更高效&quot;">​</a></h3><p>声笔简整具有静态编码的21个一简字、105个二简字和441个二简词，对其它字词的码长还可以进行动态调整，并且可以快速、精准组词，使其能不断地适应输入者的需要，逐步成为专门为用户量身定做的输入法，比以速度见长的五笔字型输入法的平均码长还短得多。</p><p>根据北京语言文化大学的大型字频率统计资料，抽取其中的GB2312汉字对几个输入法的单字输入效率所作的统计分析，在字均用键上进行比较的结果为：声笔简整（3.1678）&lt;五笔字型（3.2658）&lt;自然码（3.3061），均未计算标点符号。也就是说，声笔简整的单字输入效率比五笔字型提高了3.09%，比自然码提高了4.37%。对于大字符集（如GBK字符集和GB18030字符集），由于增加的都是不常见的汉字，所以对该统计结果基本上不会产生什么影响。不过，需要注意的是，统计是针对典型的汉字文本得出的，是在统计平均意义上的结果，并不排除有的文本会产生不同甚至相反的结果。</p><p>上面讨论的是完全用单字输入汉字且不进行动态码长调整的情况，而实际输过程中往往是字词混合输入的，而且码长是动态变化的。由于词组的数量非常庞大，而且不同的输入法所收的词组的数量和种类都不大一样，因此要根据词频表来统计字词混合输入时各种输入法的效率是非常困难的。不过，词组输入是声笔简整的强项，字词混输加动态码长调整时，声笔简整的字均码长仅为1.8左右，大大优于五笔字型，因为五笔字型的字均码长为2.2左右。</p><h3 id="_2-3-便于巩固中文" tabindex="-1">2.3 便于巩固中文 <a class="header-anchor" href="#_2-3-便于巩固中文" aria-label="Permalink to &quot;2.3 便于巩固中文&quot;">​</a></h3><p>声笔简整还是帮助人们巩固语文知识的绝佳手段。为什么呢？</p><p>现在绝大多数人使用的拼音输入法完全没有字形的信息，长期使用拼音输入法以后，往往会产生「提笔忘字」的现象，有意无意地采用同音替代，如「突破」误为「图破」、「重点」误为「终点」等；而长期使用五笔字型之类纯形码，则常常会产生「见字忘音」的现象，打字时可能出现形似替代，如「紧」误为「紫」、「租赁」误为「租凭」等。音形结合的输入法，如自然码和小鹤音形，则有利于克服这种窘境，但是需要同时掌握双拼和双形，学习难度相当大，虽然可能比学习五笔字型的门槛要低点。</p><p>声笔简整也是一种音形结合的输入法，但是用的是音里面最简单的声母（而且不分平翘舌）和形里面最简单的单笔画，而且按笔顺取，所以学习难度非常低，规范性非常好。人们「提笔忘字」和「见字忘音」基本上都只是缺少联想线索而导致想不起来了，而不是忘得一干二净。只要稍加提示，比如提示声母或者首笔，就会「哦」的一下回忆起来。故而，声笔简整以最小的代价，帮助人们巩固了语文知识——汉字的读音和字形，而且笔画和笔顺是遵从国家标准的，不是五笔字型和其他音形码那种非标准的拆分。不规范的部件和拆分仅仅是为了满足汉字输入的需要，不具备知识性，而且还会有误导的作用。五笔在这方面比较突出，成为五笔被许多人诟病的原因之一。</p><p>实际上，纯音码输入法和纯形码输入法都是不完备的中文输入法。纯音码输入法遇到不知道读音的字就无法输入，所以拼音输入法提供了U模式，用笔画或部件来反查拼音。纯形码输入法遇到想不起字形或者不会拆分的字也无法输入，所以就会「卡壳」，需要通过拼音来反查字形，比如有的五笔用户就干脆用「五笔拼音」混打模式，以便快速反查。所以，在实际使用过程中，纯音码也是离不开形的，而纯形码也是离不开音的。</p><h3 id="_2-4-便于升级方案" tabindex="-1">2.4 便于升级方案 <a class="header-anchor" href="#_2-4-便于升级方案" aria-label="Permalink to &quot;2.4 便于升级方案&quot;">​</a></h3><p>可以平滑地升级到专业的声笔飞系，以适应更复杂的输入场景。声笔简整的一简字、声笔字和二简词被原封不动地继承到了声笔飞系，而且声母、笔画的表示方法，标点符号的输入方法等等都是完全一样的，所以在升级到声笔飞系时，学习的门槛会大大地降低。而如果直接学习声笔飞系，学习难度还是相当大的，虽然总体的难度比五笔小得多，但是在声笔系列码中，声笔飞系的难度是最大的了。</p><p>另一方面，并不是每个人都需要升级到声笔飞系。实际上，对绝大多数普通用户来说，使用声笔简整才是最好的选择。为什么这么说呢？这是由他们的输入场景或者输入内容所决定的。他们的输入场景相当固定，输入的内容单一，比如聊天和围绕某个职业的内容，以词组为主，冗余度很大，声笔简整的动态码长机制能够大展拳脚，大幅度地压缩码长，节约用键，从而提高输入效率。只有那些需要随时输入不同类型的文本，比如参加随机抽样的打字比赛，或者以前的职业打字员，或者需要输入文言文、仿古文、表达独特的散文等内容时，才需要学习和使用声笔飞系。</p><h2 id="_3-快速入门" tabindex="-1">3 快速入门 <a class="header-anchor" href="#_3-快速入门" aria-label="Permalink to &quot;3 快速入门&quot;">​</a></h2><p>声笔简整极其简单，没有什么学习门槛，可以用一句话概括它的内容：用v表示零声母，用<code>aeuio</code>分别表示折、横、撇、竖、点五种笔画，采用首字母简拼加笔画编码。新用户几分钟就可以学会，几小时就可以熟练掌握，稍加训练输入速度就可以上百。</p><p>声笔简整采用分词输入。输入的基本过程是，首先输入各字的声母，观察提示，首选命中则上屏，否则追加末字笔画，在追加的同时继续观察提示，命中则上屏。在追加末字两个笔画后，若首选还没有命中，则直接补充（无需移动光标）首字的笔画，在补充的同时继续观察，命中则上屏。注意，一、二简字词的编码是静态不变的。</p><h3 id="_3-1-例解" tabindex="-1">3.1 例解 <a class="header-anchor" href="#_3-1-例解" aria-label="Permalink to &quot;3.1 例解&quot;">​</a></h3><p>本节希望通过几个具体的例子，让用户快速掌握声笔简整在默认后置强顶模式下的基本输入方法。在编码当中，下划线<code>_</code>表示空格。</p><h4 id="_3-1-1-例子1" tabindex="-1">3.1.1 例子1 <a class="header-anchor" href="#_3-1-1-例子1" aria-label="Permalink to &quot;3.1.1 例子1&quot;">​</a></h4><p>例子1: 中文输入法是中文使用者的基础工具。 方法1: <code>中文zwoe 输入法srfo 是s_ 中文zwo 使用者syze 的d_ 基础jc_ 工具。gji.</code> 方法2: <code>中文输入法zwsrF 是s_ 中文使用者zwsyZ 的d_ 基础工具。jcgj.</code></p><p>在例子1中，方法1是分词颗粒度比较细的打法，而方法2是颗粒度比较粗的打法。下面给出详细的操作过程，因为简拼是动态调频的，用户的结果不一定会一模一样，但是并不妨碍对操作方法的理解。方法2是建立在已经使用过方法1的前提下的，类似于实际输入过程中，上文已经出现过类似的句子，所以可以通过更粗的分词了进一步压缩编码，从而节约用键。</p><p>使用方法1时，首先输入「中文」里两字的声母zw，观察首选不是「中文」（若能记住二简词，是不必观察的），于是追加「文」的首笔点o，还是未命中，再追加「文」的次笔横e，命中了。这时，不必空格上屏，而是接着输入「输入法」中第一个字「输」的声母s，「中文」会被顶上屏幕，接着输入「入法」的声母rf和「法」的首笔点o，首选就是「输入法」了。为什么输入三个声母后不进行观察呢？因为在默认模式下，三个声母对应的肯定是二简词和一简字的组合「虽然发」，肯定不是「输入法」，所以只需要在追加末字的首笔再观察提示。接下来，键入「是」的声母s，将「输入法」顶上屏幕，用空格键上屏一简字「是」，因为一简字是不能顶屏的。接着，输入zwo，即开始观察提示，因为简拼的二字词是三码起开始调频的，发现「中文」已经在首选。于是，键入syze，将「中文」顶上屏幕，发现首选就是所需的「使用者」。再键入d，将「使用者」顶上屏幕，并用空格上屏「的」字。然后，输入jc，发现「基础」已经是首选，二简词不能顶屏，所以用空格上屏。最后，键入gj，二简词是「国家」，于是追加「具」的首笔竖i，命中了「工具」，直接键入句号顶屏，完成整句话的输入，包括句号本身。</p><p>使用方法2时，「中文输入法」的末字声母要用大写，否则小写的f会将前四个声母对应的词「中文输入」顶上屏幕。实际上，在默认的强顶模式下，大于五字的声母都要用大写来输入，这是编码规则。因为zwsrF对应的首选正好是「中文输入法」，所以接着键入s，就将其顶上屏幕了，然后再用空格上屏「是」字。类似地，输入zwsyZ，正好命中了「中文使用者」，键入d将其顶上屏幕，用空格上屏「的」字。最后，键入jcgj，发现首选没有命中，于是追加末字首笔i，首选变成了「基础工具」，直接句号顶屏，完成全句输入。</p><h4 id="_3-1-2-例子2" tabindex="-1">3.1.2 例子2 <a class="header-anchor" href="#_3-1-2-例子2" aria-label="Permalink to &quot;3.1.2 例子2&quot;">​</a></h4><p>例子2：白杨树实在是不平凡的，我赞美白杨树！ 方法: 白杨树bysei 实在是szsi 不平凡bpfu 的，d, 我w_ 赞美zmou&#39;u 白杨树！byse!</p><p>在例子2中，键入byse后，首选并不是「白杨树」，需要继续追加末字的次笔才命中。接下来的szsi，在顶出前面的词组后，直接命中了「实在是」。「不平凡」也被bpfu命中。然后，d就是对应的一简字「的」，后接逗号直接顶屏。</p><h4 id="_3-1-3-例子3" tabindex="-1">3.1.3 例子3 <a class="header-anchor" href="#_3-1-3-例子3" aria-label="Permalink to &quot;3.1.3 例子3&quot;">​</a></h4><p>例子3：声笔简整最有可能成为智能全拼后的下一个全民输入方案。 方法1：声笔sbue&#39;e 简拼jpei&#39;ueo 最有可能zykn 成为cw_ 智能znao&#39;ue 全拼qpei&#39;uoe 后h7 的d_ 下一个xygu 全民qma 输入方案。srfv. 方法2：声笔简整sbjpe 最有可能zykn 成为cw_ 智能全拼znqp 后h7 的d_ 下一个xygu 全民qma 输入方案。srfv.</p><h4 id="_3-1-4-例子4" tabindex="-1">3.1.4 例子4 <a class="header-anchor" href="#_3-1-4-例子4" aria-label="Permalink to &quot;3.1.4 例子4&quot;">​</a></h4><p>例子4: 子曰：人而不仁，如礼何？人而不仁，如乐何？ 方法：子曰：zyia&#39;a, 人而rv; 不仁，brui&#39;e, 如ra 礼loai 何hu8 ？? 人而rv; 不仁，bru, 如ra 乐yuaiu 何hu8 ？?</p><h3 id="_3-2-简要说明" tabindex="-1">3.2 简要说明 <a class="header-anchor" href="#_3-2-简要说明" aria-label="Permalink to &quot;3.2 简要说明&quot;">​</a></h3><p>虽然声笔简整已经非常简单了，但是为了进一步减轻初学者的记忆负担，在手机上提供了助记皮肤，可以长按<code>N</code>键打开或者关闭助记。在打开时，给出了笔画和零声母用键（<code>aeuio</code>和<code>v</code>）的提示，如下图所示。如果是在电脑上，则可以把该图放在电脑桌面上，在打字的时候帮助记忆，一般几分钟就记住了。</p><p><img src="'+r+'" alt="image-20230813150212256"></p><p>当一个字有多种不同的读音且声母不同时，则可以用多种方法输入该字。例如，「盛」对应的拼音有<code>cheng</code>和<code>sheng</code>，对应了c和s两个不同的声母，因而它在声笔简整中也会有两个编码，分别是<code>ceua</code>和<code>seua</code>。</p><p>对于非成字偏旁部首，一般取其名称首字的声母作为它的声母进行编码。例如，「亻」的名称为单人旁，取「单」字的声母d作为「亻」的声母，可以用<code>duii</code>输入「亻」。不知道非成字偏旁部首的名称也没有关系，因始终可以用纯笔画的方式输入。比如，「亻」可以用<code>uiiii</code>输入。</p><p>对于笔画不是很熟悉的人来说，有个别汉字和偏旁部首的笔顺容易弄错，在<a href="./../sbjc/">声笔基础</a>的附录二中罗列了出来，建议对不熟习笔画的人集中浏览，快速学习一下。熟练掌握正确的汉字笔画，不仅是学习中文的目标之一，也是用好声笔简整和声笔其它输入方案的前提条件，必须高度重视。因为笔画和笔顺是一种语文知识，所以系统没有为其提供容错码，即用户必须使用正确的笔画和笔顺才能输入，纠正错误的过程也是学习知识的过程。</p><h3 id="_3-3-缩减编码" tabindex="-1">3.3 缩减编码 <a class="header-anchor" href="#_3-3-缩减编码" aria-label="Permalink to &quot;3.3 缩减编码&quot;">​</a></h3><p>声笔简整中的缩减编码，又称为缩减码，可以缩短字词的输入码，类似于搜狗拼音中的固顶字词或者五笔字型中的简码字，或称简码。</p><p>声笔简整的单字有一、二、三级简码，分别称为一简字、二简字和三简字。一简字的例子有<code>就j 我w 没m</code>。二简字的例子有<code>从cu 此ci 起qe 来le</code>。三简字的例子有<code>机jei 威weu 凝noe 关gou</code>。</p><p>声笔简整的二字词有二、三级简码，分别称为二简词和三简词。二简词的例子有<code>关系gx 参加cj 东西dx 会议hy</code>。三简词的例子有<code>高兴gxo 设计sjo 密封mfe 决定jdo</code>。</p><p>声笔简整的一、二简字词是固定不变的，便于形成条件反射。三简字词和全码字词一样会随着用户的使用习惯发生变化。</p><p>另外，声笔简整在三简的码位安排了二简词和一简字的组合，也可以节约用键，要尽量使用。例如，<code>我们的wmd 他们是tms 进行了jxl</code>。这种设计确定性高，比安排大量的三字词简码更容易掌握，而且不少组合使用频率还是很高的。</p><h3 id="_3-4-编码反查" tabindex="-1">3.4 编码反查 <a class="header-anchor" href="#_3-4-编码反查" aria-label="Permalink to &quot;3.4 编码反查&quot;">​</a></h3><p>在使用简码时，特别是在学习简码之初，有时会遇到不会打的字。怎么办呢？程序提供了丰富的反查手段，可以通过笔画和拼音来反查编码，还可以采用字海两分来反查和输入非 GBK 汉字。另外，还通过反查提供了临时拼音输入法。</p><h4 id="_3-4-1-拼音反查" tabindex="-1">3.4.1 拼音反查 <a class="header-anchor" href="#_3-4-1-拼音反查" aria-label="Permalink to &quot;3.4.1 拼音反查&quot;">​</a></h4><p>在知道拼音而不知道字形时用 a 引导拼音反查，注意零声母要用 v 充当。</p><p>例如，要反查「访」字的编码，就在输入 a之后再输入它的拼音 fang，所以实际的输入为 afang，结果如下图所示。反查出「访」字的编码为 foaoea。如果是多音字，那么就会有多个编码，如图中的「房」字就有 foaeuo 和 poaeuo 两个编码。</p><p><img src="'+l+'" alt="image-20240304133542519"></p><p>对于零声母字，如「案」字，在反查时除了用 a 引导还需要在正常拼音的前面加 v，因为 an 是零声母音，所以实际的输入为 avan。在图中提示出的<code>案vooaau</code>，表示「案」字的编码为 vooaau。</p><p><img src="'+n+'" alt="image-20240304133632018"></p><h4 id="_3-4-2-笔画反查" tabindex="-1">3.4.2 笔画反查 <a class="header-anchor" href="#_3-4-2-笔画反查" aria-label="Permalink to &quot;3.4.2 笔画反查&quot;">​</a></h4><p>在完全不知道读音的时候，直接用 <code>aeuio</code> 按顺序输入笔画进行反查，无需引导。</p><p>在下面的笔画反查的例子中，不用引导而直接输入 uuao 后，出现了以这四个笔画开头的字。第一项是<code>反fuuaoo</code>，表示「反」字的编码为 fuuaoo。第二项为<code>般buuaoe puuaoe</code>，说明「般」是个多音字，有两个编码。</p><p><img src="'+i+'" alt="image-20221116104334471"></p><h4 id="_3-4-3-两分反查" tabindex="-1">3.4.3 两分反查 <a class="header-anchor" href="#_3-4-3-两分反查" aria-label="Permalink to &quot;3.4.3 两分反查&quot;">​</a></h4><p>通过 i 引导的拼音还支持用字海两分法来进行反查， 支持查找八万多汉字，一般用于反查难读而易于两分的字或者输入 GBK 以外的字。GBK 以外的字，声笔简整不提供正常编码，不能按正常方式输入，只能在两分查找到后选择输入。引导字母i可以理解为英文inquire（询问）的首字母，以便记忆</p><p>下面是字海两分法查找的例子。第一个例子是反查「龖」字的编码，在输入到第二部分拼音的第一码时就出来了。第二个例子是通过输入「尸」和「水」的拼音来反查「尿」的编码，输入了两部分完整的拼音。</p><p><img src="'+o+'" alt="image-20240304133702409"></p><p><img src="'+c+'" alt="image-20240304133733369"></p><p>对于非 GBK 字集里的「㕛」字，它是没有编码的，只能用两分法来输入，如下所示。此时，需要移动光标选中该字，然后再用空格上屏。</p><p><img src="'+s+'" alt="image-20240304133816857"></p><h4 id="_3-4-4-临时拼音" tabindex="-1">3.4.4 临时拼音 <a class="header-anchor" href="#_3-4-4-临时拼音" aria-label="Permalink to &quot;3.4.4 临时拼音&quot;">​</a></h4><p>在一时半会想不起某个词中某个字的笔画，而这个字因为不常见又不方便用单字进行反查时，可以用 a 引导临时拼音来变相地输入词组或者查到该字的写法。但是，对于反查出来的词组是不会显示编码的。</p><p>例如，「饕餮」可以用 ataotie 来查找和输入，而「耄耋」可以用 amaodie 来查找和输入。注意，用于引导的字母a是不会显示的。</p><p><img src="'+p+'" alt="image-20221116104939053"></p><p><img src="'+h+'" alt="image-20240316120847304"></p>',75),x=[g];function u(y,b,m,f,q,k){return a(),e("div",null,x)}const j=t(_,[["render",u]]);export{z as __pageData,j as default};
